import React from "react";
import TaskBar from "./TaskBar";
import DayLeftRender from "../DayLeftRender";

function Over(props) {

//   const upcomingTasks = props.data.filter((task) => {
//     return task["done"] !== 1;
//   });
const overedTasks = DayLeftRender(props.data);

  return (
    <div className="upcoming-tasks col-sm-6 col-lg-6 p-2">
      <h1 className="title">Upcoming tasks</h1>
      <div className="board scroll upcoming-board">
        <ul className="m-4 p-0">
        {upcomingTasks.map((task, index) => {
          return (
            <TaskBar
              key={index}
              id={index}
              taskItem={task}
              onDelete={props.delete}
              onDone={props.done}
            />
          );
        })}
        </ul>
      </div>
    </div>
  );
}

export default Over;
